import { IProducts } from "pages/products";
import React from "react";

const Products: React.FC<IProducts> = (product: IProducts) => {
  return (
    <div>
      <div className="card">
        <img src={product.picture} alt="" />
        <p>Tag: SoftWare</p>
      </div>
    </div>
  );
};

export default Products;
